insert  into `artikel`(`id`,`gambar`,`isi`,`enabled`,`tgl_upload`,`id_kategori`,`id_user`,`judul`,`headline`,`gambar1`,`gambar2`,`gambar3`,`dokumen`,`link_dokumen`,`boleh_komentar`,`slug`,`hit`,`urut`,`jenis_widget`) values 
(108,'1648662601_kkn.jpg','<p>STP NHI BANDUNG mengirim mahasiswa/i dalam program KKN-PPM di Desa Neglasari pada tanggal 9 November - 29 November 2021. Ini adalah salah satu bentuk pengembangan desa yang melibatkan mahasiswa/i dalam program pengabdian masyarakat. Ini sangat membantu Desa kami yang sangat membutuhkan ide, saran kreatif dari Akademisi Pariwisata dalam pengembangan pariwisata yang ada di Desa. Melalui Wawancara dari salah satu mahasiswa STP NHI BANDUNG, \"Kami mempunyai program Pengembangan Produk Wisata diantaranya, Digitalisasi desa berbasis website, Video Promosi, Pelatihan Pemandu wisata, Marka ke tempat wisata, Perencanaan Pola perjalanan\". ujar Firda.</p>',1,'2021-11-22 12:26:36',1,20,'Mahasiswa-mahasiswi STP NHI BANDUNG Mengembangkan Produk Wisata di Desa Neglasari',3,NULL,NULL,NULL,NULL,'Pengembangan Produk Wisata di Desa Neglasari oleh Mahasiswa KKN-PPM STP NHI BANDUNG',1,'mahasiswa-mahasiswi-stp-nhi-bandung-mengembangkan-produk-wisata-di-desa-neglasari',92,NULL,3),
(109,'1639187204_forkopim.jpg','<ol>\r\n<li><strong> </strong><strong>SEJARAH TERBENTUKNYA DESA NEGLASARI</strong></li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Berbicara historis tentang desa Neglasari, keberadaannya tidak terlepas dari salah satu sekolah dasar yang ada di desa ini. Konon sebelum desa Neglasari terbentuk menjadi desa, di wilayah ini <em>(Desa Neglasari)</em> dahulu kala masih berada dalam wilayah Desa Sindangsari, dimana di wilayah Desa Sindangsari tersebut berdiri empat sekolah dasar yaitu, SDN (Sekolah Dasar Negeri) Sindangsari 1, SDN (Sekolah Dasar Negeri) Sindangsari 2, SDN (Sekolah Dasar Negeri) Sindangsari 3 dan SDN (Sekolah Dasar Negeri) Sindangsari 4. Ke-empat sekolah tersebut diberi nama dengan kata akhir &ldquo;sari&rdquo; kalau boleh kita artikan sekarang kata sari tersebut, bisa diartikan dengan &ldquo;inti , awal dari kepemerintahan&rdquo;. Para pendiri atau nenek moyang <em>(founding father)</em> kita mungkin mempunyai keinginan bahwa para siswa/peserta didik, masyarakat yang ada di wilayah ini mempunyai totalitas serta dedikasi yang tinggi dalam berbakti kepada allah, berbakti dan memajukan daerahnya serta nusa dan bangsa pada umumnya.</p>\r\n<p>Desa Sindangsari secara geografis dan jumlah penduduk yang cukup banyak memungkinkan untuk melaksanakan pemekaran. Dilihat dari proses tersebut, kemudian intruksi pun datang dari pusat bahwa Desa Sindangsari yang terangkum dalam wilayah kecamatan Cisompet harus melakukan pemekaran.&nbsp; Secara otomatis dukungan pun berdatangan baik dari masyarakat biasa maupun dari pihak tokoh-tokoh masyarakat yang ada di Neglasari. Bahkan konon katanya Bupati pun ikut mendukung terhadap pemekaran desa tersebut. Pucuk dicinta ulam tiba, itulah kiranya pribahasa yang tepat. Pada sekitar tahun 1981 akhirnya pemekaran pun terlaksana, yang pasti sebelumnya pihak desa menempuh jalur administrasi ke pihak kabupaten.</p>\r\n<p>Setelah terjadi pemekaran, para tokoh berembug untuk memberikan nama yang tepat untuk desa yang baru. Setelah menempuh proses yang cukup lama, kemudian semua orang yang terlibat dalam proses pencarian nama sepakat bahwa untuk nama desa diambil dari salah satu sekolah dasar (SD) yaitu &ldquo;Sekolah Dasar Negeri Neglasari&rdquo;.</p>\r\n<p>&nbsp;</p>\r\n<p>Begitulah cerita singkat mengenai <em>seluk beluk</em> atau <em>sasakala</em> tentang desa Neglasari. Kepala desa definitif yang pertama menjalankan roda kepemimpinannya adalah Bapak Udin (Alm) yang bisa kita sebut sebagai saksi dan pelaku sejarah dalam proses pembentukan desa Neglasari.&nbsp; Para kepala desa dari awal sampai sekarang ditulis dalam tabel.</p>',1,'2021-12-02 18:02:19',1,20,'Sejarah Desa',0,NULL,NULL,NULL,NULL,'',1,'sejarah-desa',71,NULL,3),
(110,'1639187188_forkopim.jpg','<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',1,'2021-12-02 18:37:42',1,20,'Struktur Pemerintahan',0,NULL,NULL,NULL,'struktur.pdf','Struktur Pemerintahan',1,'struktur-pemerintahan',55,NULL,3),
(111,'1639187159_forkopim.jpg','<p><strong>Pemerintah Desa</strong></p>\r\n<p>Pemerintah Desa mempunyai tugas membinan kehidupan masyarakat Desa, membina perekonomian, dan memelihara ketentraman dan ketertiban masyarakat desa serta mengajukan rancangan Peraturan Desa serta menetapkannya sebagi Peraturan Desa, untuk menyelenggarakan tugas tersebut Pemerintah Desa mempunyai fungsi :</p>\r\n<ul>\r\n<li>Pelaksanaan pembinaan masyarakat desa;</li>\r\n<li>Pelaksanaan pembinaan perekonomian desa;</li>\r\n<li>Pemeliharaan ketentraman dan ketrtiban masyarakat desa;</li>\r\n<li>Pelaksanaan musyawarah penyelesaian perselisihan masyarakat di desa;</li>\r\n<li>Penyusunan dan penagjuan rancangan peraturan desa dan menetapkan sebagi peraturtan desa bersama BPD; dan</li>\r\n<li>Peningktan kualitas keimanan dan ketaqwaan kepada Tuhan Yang Maha Esa.</li>\r\n</ul>',1,'2021-12-02 19:05:16',1,20,'Pemerintah Desa',0,NULL,NULL,NULL,NULL,'Pemerintah Desa',1,'pemerintah-desa',45,NULL,3),
(112,'1639185772_forkopim.jpg','<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"44\">\r\n<p><strong>NO</strong></p>\r\n</td>\r\n<td width=\"333\">\r\n<p><strong>NAMA KEPALA DESA</strong></p>\r\n</td>\r\n<td width=\"187\">\r\n<p><strong>MASA JABATAN</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"333\">\r\n<p>Bapak Udin</p>\r\n</td>\r\n<td width=\"187\">\r\n<p>1982 - 1997</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"333\">\r\n<p>Bapak Sutarmin</p>\r\n</td>\r\n<td width=\"187\">\r\n<p>1997 - 1999</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"333\">\r\n<p>Ibu Cucu</p>\r\n</td>\r\n<td width=\"187\">\r\n<p>1999-2001</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"333\">\r\n<p>Bapak A.Sobandi</p>\r\n</td>\r\n<td width=\"187\">\r\n<p>2001-2003</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44\">\r\n<p>5</p>\r\n</td>\r\n<td width=\"333\">\r\n<p>Bapak Iyan Suryana</p>\r\n</td>\r\n<td width=\"187\">\r\n<p>2003-2009</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44\">\r\n<p>6</p>\r\n</td>\r\n<td width=\"333\">\r\n<p>Bapak Sobandi</p>\r\n</td>\r\n<td width=\"187\">\r\n<p>2009-2014</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44\">\r\n<p>7</p>\r\n</td>\r\n<td width=\"333\">\r\n<p>Bapak Adin Saripudin</p>\r\n</td>\r\n<td width=\"187\">\r\n<p>2015-2021</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>',1,'2021-12-11 08:22:00',999,1,'Daftar Kepala Desa Dari Awal Pembentukan Sampai Sekarang',0,NULL,NULL,NULL,NULL,'',1,'daftar-kepala-desa-dari-awal-pembentukan-sampai-sekarang',46,NULL,3),
(113,'1648665766_Inilah Keseruan Rombongan Ridwan Kamil Explore dan Berenang Di Curug Jaga Pati - Garut Selatan - You (1) (1).jpg','<p>Banggalah dengan kekayaan alam Indonesia.</p>\r\n<p>Kekayaan yang terpendam di darat dan di lautan, flora dan faunanya, bahan tambang yang melimpah, kesuburan tanah,&nbsp; serta keindahan alam yang begitu sempurna menjadikan Indonesia berada dilevel Negara terindah di dunia. Patut kiranya kita bersyukur atas ciptaan_Nya, bangga terhadap apa yang kita miliki dengan cara memelihara, melestarikan dan memanfaatkannya tanpa eksploitasi yang berlebihan.</p>\r\n<p>Keelokan alam yang terdapat di Desa Neglasari Kecamatan Cisompet tidak kalah indahnya dengan tempat-tempat lain di Indonesia maupun di dunia. Salahsatunya yaitu Curug Jagapati yang telah masyhur tidak hanya sekedar dikalangan wisatawan domestik saja, bahkan keindahannya telah menggelitik minat wisatawan asing untuk menyempatkan berkunjung dan menikmati fanorama air terjun yang terdiri dari beberapa susunan itu.</p>\r\n<p>Curug Jagapati&nbsp; terletak di Dusun Padarame-Cipicung dengan nuansa yang masih sangat alami, perlu perhatian dari semua pihak agar keberadaannya tetap terjaga dan terhindar dari tangan-tangan jahil pihak yang tidak bertanggungjawab.</p>\r\n<p>&nbsp;</p>',1,'2022-02-16 12:02:19',22,31,'\"Jagapati\" Surga Tersembunyi di Garut Selatan',1,NULL,NULL,NULL,NULL,'',1,'jagapati-surga-tersembunyi-di-garut-selatan',22,NULL,3),
(114,'1647158870_20220311_110032.jpg','<p>Bersama seluruh perangkat desa, Kepala Desa Neglasari mengadakan rapat internal membahas persiapan pelaksanaan lomba desa tahun 2022 yang akan diselenggarakan pada triwulan pertama tahun ini.</p>\r\n<p>&nbsp;</p>',1,'2022-03-11 15:07:18',4,1,'Rapat Internal Persiapan Jelang Lomba Desa 2022',3,NULL,NULL,NULL,NULL,'',1,'rapat-internal-persiapan-jelang-lomba-desa-2022',26,NULL,3),
(115,'1648663470_1 Penyemprotan.jpg','<p>Kegiatan Penyemprotan Dalam Upaya Pencegahan Penyebaran Covid-19 dilaksanakan di seluruh fasilitas umum, lingkungan pemukiman dan area tertentu yang memungkinkan menjadi salah satu lokasi penyebaran penyakit.</p>\r\n<p>Pelaksanaan Kegaiatan Penyemprotan dibantu oleh Tim Satgas Covid-19, yang terdiri atas jajaran Puskesmas, Kecamatan, Polsek, Koramil, Perangkat Desa serta bersama Lembaga dan Relawan lainnya.</p>',1,'2021-04-14 01:03:36',4,1,'Kegiatan Penyemprotan Desinfektan Di Dusun Padarame Dalam Upaya Pencegahan Penyebaran Covid-19',3,NULL,NULL,NULL,NULL,'',1,'kegiatan-penyemprotan-desinfektan-di-dusun-padarame-dalam-upaya-pencegahan-penyebaran-covid-19',17,NULL,3),
